script: |
  super -f text -I q3603.spq | sort > q3603.out

inputs:
  - name: q3603.spq
    data: |
      SELECT - col0 * - CAST ( NULL AS INTEGER ) FROM tab0 (FORMAT parquet) WHERE NOT + CAST ( NULL AS INTEGER ) / 68 NOT BETWEEN + col2 AND + CAST ( NULL AS REAL ) * col0;
  - name: tab0

outputs:
  - name: q3603.out
    data: |
